import React from "react";
import classes from "./PostcodeForm.module.css"
import { History } from "history";

export const PostcodeForm = ({ history }: { history?: History }) => {

      const [postCode,setPostCode] = React.useState("");
      const location = useLocation();

      const handleChange = (e:any) => {
        setPostCode(e.target.value);
      }

      const handleSubmit = (e:any) => {
        e.preventDefault();
        history?.push(`/${postCode}`)  
      }

        return (
          <div className={classes.fullscreenDiv} >
          <form onSubmit={handleSubmit}>
            <div className={classes.center}>
            <label className={classes.padding} >
              Postcode:
              <input type="text" className={classes.textbox} value={postCode} onChange={handleChange} />
            </label>
            <input type="submit" className={classes.button} value="Submit" />
            </div>
          </form>
          </div>
        );

}
